export default class Footer extends Component {
  constructor(props) {
		super(props);
		this.state = {

		};
  }

  render() {
    return (
      <div id="footer">
        <div className="footer_top">
          <div className="footer_wrapper">
            <h3>Sarah Alt</h3>
            <h5>Frontend Developer. Psychologist. Entrepreneur.</h5>
            <h5>Currently looking for a job.</h5>
            <div className="footer_contact">
              <a href=""><img className="heart" src="/assets/images/icons/heart.png" alt=""/></a>
              <img className="heart" src="/assets/images/icons/heart.png" alt=""/>
            </div>
            <span>Made with <img className="heart" src="/assets/images/icons/heart.png" alt=""/> in Munich, Germany</span>
          </div>
        </div>
        <div className="footer_overlay">

        </div>
        <div className="footer_bottom">
          <p>English</p>
        </div>
      </div>
    )
  }
}
